	<p>–ï–ô, –¢–ò! –†–∞–¥—ñ —Ç–µ–±–µ —Ç—É—Ç –±–∞—á–∏—Ç–∏. –ë–∞–∂–∞—î—à –ø–æ–∑–Ω–∞–π–æ–º–∏—Ç–∏—Å—è –∑ –Ω–æ–≤–æ—é –ª–µ—Å–±—ñ—è–Ω–∫–æ—é, –¥–∏–≤–Ω–æ—é –∂—ñ–Ω–∫–æ—é –∞–±–æ –±—ñ—Å–µ–∫—Å—É–∞–ª–∫–æ—é? –¶–µ —Å—Ç–∞–ª–æ —Å—É–ø–µ—Ä-–ø—Ä–æ—Å—Ç–æ –∑–∞–≤–¥—è–∫–∏ SPICY - –Ω–∞–π–Ω–æ–≤—ñ—à–æ–º—É –∂—ñ–Ω–æ—á–æ–º—É –¥–æ–¥–∞—Ç–∫—É –¥–ª—è —Å–ø—ñ–ª–∫—É–≤–∞–Ω–Ω—è —Ç–∞ –∑–Ω–∞–π–æ–º—Å—Ç–≤. –î—ñ–∑–Ω–∞–π—Å—è, —Ö—Ç–æ —Ç–æ–±—ñ –ø–æ–¥–æ–±–∞—î—Ç—å—Å—è —ñ —Å–∞–º–µ –¢–ò –±—É–¥–µ—à –≤–∏—Ä—ñ—à—É–≤–∞—Ç–∏, —è–∫ –¥–∞–ª–µ–∫–æ —Ü–µ –º–æ–∂–µ –∑–∞–π—Ç–∏. –£ –Ω–∞—Å —î –ø–æ–Ω–∞–¥ 20 –º—ñ–ª—å–π–æ–Ω—ñ–≤ –∫–æ—Ä–∏—Å—Ç—É–≤–∞—á—ñ–≤ —Ç–∞ –±—ñ–ª—å—à–µ –ø—Ä–∏—î–¥–Ω—É—é—Ç—å—Å—è —â–æ–¥–Ω—è.</p>
<p>–ó SPICY –º–æ–∂–Ω–∞ –ª–µ–≥–∫–æ –∑–Ω–∞–π—Ç–∏ –≥–∞—Ä—è—á—É –ª–µ–¥—ñ! –ú–∏ –≤—ñ—Ç–∞—î–º–æ —Ä—ñ–∑–Ω–æ–º–∞–Ω—ñ—Ç–Ω—ñ—Å—Ç—å —Ç–∞ –∑–∞–ø—Ä–æ—à—É—î–º–æ —É—Å—ñ—Ö –ª–µ—Å–±—ñ—è–Ω–æ–∫, –±—ñ—Å–µ–∫—Å—É–∞–ª—ñ–≤ —Ç–∞ —Ç—Ä–∞–Ω—Å–≥–µ–Ω–¥–µ—Ä—ñ–≤ –õ–ì–ë–¢ –ø—Ä–∏—î–¥–Ω–∞—Ç–∏—Å—å –¥–æ –≤–µ—á—ñ—Ä–∫–∏. –£ –≥—Ä—ñ –∑ –ø–æ—à—É–∫—É –ø–∞—Ä —Ç–∏ –≤–∏—Ä—ñ—à—É–≤–∞—Ç–∏–º–µ—à, —Ö—Ç–æ –ø–æ–¥–æ–±–∞—î—Ç—å—Å—è —Ç–æ–±—ñ, –∞ —Ö—Ç–æ - –Ω—ñ. –¢–∏ –æ—Ç—Ä–∏–º—É–≤–∞—Ç–∏–º–µ—à –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω–Ω—è —Ç—ñ–ª—å–∫–∏ –≤—ñ–¥ —Ç–∏—Ö, —Ö—Ç–æ —Ç–æ–±—ñ –ø–æ–¥–æ–±–∞—î—Ç—å—Å—è —Ç–∞ –±—É–¥–µ—à —Å–∞–º–æ—Å—Ç—ñ–π–Ω–æ –≤–∏—Ä—ñ—à—É–≤–∞—Ç–∏, —Ö—Ç–æ –º–æ–∂–µ –ø–æ—á–∏–Ω–∞—Ç–∏ —Ä–æ–∑–º–æ–≤—É –∑ —Ç–æ–±–æ—é.</p><strong><a id='x2'></a><h2>–ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ –¥–ª—è –ª–µ—Å–±—ñ—è–Ω–æ–∫ (–±—ñ)</h2></strong><p>–ü–æ–¥–æ–±–Ω—ã–µ —Ä–∞—Å—à–∏—Ä–µ–Ω–∏—è –∏ –Ω–∞—Å—Ç—Ä–æ–π–∫–∏ –Ω–µ–≥–∞—Ç–∏–≤–Ω–æ –≤–ª–∏—è—é—Ç –Ω–∞ —Ñ—É–Ω–∫—Ü–∏–æ–Ω–∞–ª —Å–∞–π—Ç–∞. –ß–∞—Å—Ç—å —Ñ—É–Ω–∫—Ü–∏–æ–Ω–∞–ª–∞ –º–æ–∂–µ—Ç –±—ã—Ç—å. –Ω–µ–¥–æ—Å—Ç—É–ø–Ω–∞ –∏–ª–∏ —Ä–∞–±–æ—Ç–∞—Ç—å —Å –æ–≥—Ä–∞–Ω–∏—á–µ–Ω–∏—è–º–∏. –ö–∞–∫ –æ—Ç–∫–ª—é—á–∏—Ç—å - —á–∏—Ç–∞–π—Ç–µ –∑–¥–µ—Å—å. –ó–∞—Ä–∞–∑ –Ω–∞ —Å–∞–π—Ç—ñ –Ω–µ–º–∞—î —Ç–æ–≤–∞—Ä—ñ–≤ –∞–±–æ –ø–æ—Å–ª—É–≥, —â–æ –≤—ñ–¥–ø–æ–≤—ñ–¥–∞—é—Ç—å –í–∞—à–æ–º—É –∑–∞–ø–∏—Ç—É. –°–ø—Ä–æ–±—É–π—Ç–µ –∑–º—ñ–Ω–∏—Ç–∏ –ø–∞—Ä–∞–º–µ—Ç—Ä–∏ –ø–æ—à—É–∫—É. –î–æ —Ä–µ—á—ñ, –í–∏ –º–æ–∂–µ—Ç–µ —Å—Ç–∞—Ç–∏ –ø–µ—Ä—à–∏–º –≤ —Ü—ñ–π —Ä—É–±—Ä–∏—Ü—ñ. –ü—Ä–æ—Å—Ç–æ —Å—Ç–≤–æ—Ä—ñ—Ç—å –º–∞–≥–∞–∑–∏–Ω —ñ –¥–æ–¥–∞–π—Ç–µ –≤ –Ω—å–æ–≥–æ –æ–≥–æ–ª–æ—à–µ–Ω–Ω—è. –î–æ —Ä–µ—á—ñ, –í–∏ –º–æ–∂–µ—Ç–µ —Å—Ç–∞—Ç–∏ –ø–µ—Ä—à–∏–º —É —Ü—ñ–π —Ä—É–±—Ä–∏—Ü—ñ.</p>
<p>–ü—Ä–æ—Å—Ç–æ —Ä–æ–∑–º—ñ—Å—Ç—ñ—Ç—å –æ–≥–æ–ª–æ—à–µ–Ω–Ω—è. –ù–µ –ø–æ—Ç—Ä—ñ–±–Ω–æ –¥–µ—Ç–∞–ª—å–Ω–æ –≥–æ–≤–æ—Ä–∏—Ç–∏ –ø—Ä–æ —Å–∫–ª–∞–¥–Ω–æ—â—ñ –≥–µ–π-–∑–Ω–∞–π–æ–º—Å—Ç–≤ –≤ –£–∫—Ä–∞—ó–Ω—ñ, —Ç–µ–º–∞ –æ–±–≥–æ–≤–æ—Ä—é—î—Ç—å—Å—è –≤ —Å–ø–µ—Ü—ñ–∞–ª—ñ–∑–æ–≤–∞–Ω—ñ–π –ø—Ä–µ—Å—ñ —ñ —Å–∫–∞–∑–∞–Ω–æ –¥–æ—Å–∏—Ç—å. –ù–∞–±–∞–≥–∞—Ç–æ –∞–∫—Ç—É–∞–ª—å–Ω—ñ—à–µ —Ç–æ—Ä–∫–Ω—É—Ç–∏—Å—è –º–æ–∂–ª–∏–≤–∏—Ö —Ä—ñ—à–µ–Ω—å, –Ω–∞–¥–∞—Ç–∏ –º–æ–∂–ª–∏–≤—ñ—Å—Ç—å –æ—Å–æ–±–∏—Å—Ç–æ–≥–æ –≤–∏–±–æ—Ä—É, –∑–∞–ø—Ä–æ–ø–æ–Ω—É–≤–∞—Ç–∏ —Å–ø–æ—Å—ñ–± —Ä–µ–∞–ª—ñ–∑—É–≤–∞—Ç–∏ –ø–æ—Ç—Ä–µ–±–∏ –≤ –∑–Ω–∞–π–æ–º—Å—Ç–≤—ñ "—á–æ–ª–æ–≤—ñ–∫-—á–æ–ª–æ–≤—ñ–∫" –±–µ–∑ —Ä–∏–∑–∏–∫—É.</p><strong><a id='x3'></a><h2>–ì–µ–π –∑–Ω–∞–π–æ–º—Å—Ç–≤–∞ –≤ –£–∫—Ä–∞—ó–Ω—ñ ‚úîÔ∏è –°–∞–π—Ç –∑–Ω–∞–π–æ–º—Å—Ç–≤ –ë–µ—Å–ø–ª–∞—Ç–∫–∞</h2></strong><p>–Ø–∫–∏—Ö –ø—Ä–∞–≤–∏–ª –ø–æ—Ç—Ä—ñ–±–Ω–æ –¥–æ—Ç—Ä–∏–º—É–≤–∞—Ç–∏—Å—è –ø—Ä–∏ –æ–Ω–ª–∞–π–Ω-–∑–Ω–∞–π–æ–º—Å—Ç–≤–∞—Ö? –Ø–∫–∏—Ö –ø–æ–º–∏–ª–æ–∫ —Ç—Ä–µ–±–∞ –Ω–∞–º–∞–≥–∞—Ç–∏—Å—è —É–Ω–∏–∫–∞—Ç–∏? –ö—É–ª—å—Ç—É—Ä–Ω–∏–π –ø—Ä–æ—Å—Ç—ñ—Ä —ñ —Å–ª–æ–≤–Ω–∏–∫ –≥–µ–π-–∑–Ω–∞–π–æ–º—Å—Ç–≤ –≤ —ñ–Ω—Ç–µ—Ä–Ω–µ—Ç—ñ –±–∞–≥–∞—Ç–æ –≤ —á–æ–º—É —î "–∫–∞–ª—å–∫–æ—é" –∑ –∞–Ω–≥–ª–æ–º–æ–≤–Ω–∏—Ö –∑—Ä–∞–∑–∫—ñ–≤. –†–æ–∑—É–º—ñ–Ω–Ω—è —Å–ª–æ–≤–∞ " –≥–µ–π " –Ω–µ–æ–¥–Ω–æ–∑–Ω–∞—á–Ω–µ —ñ –º–æ–∂–µ –æ–∑–Ω–∞—á–∞—Ç–∏ —è–∫ —á–æ–ª–æ–≤—ñ–∫–∞, —è–∫–æ–≥–æ —Ü—ñ–∫–∞–≤–ª—è—Ç—å —á–æ–ª–æ–≤—ñ–∫–∏, —Ç–∞–∫ –º–∞—Ç–∏ —à–∏—Ä–æ–∫–µ –∑–Ω–∞—á–µ–Ω–Ω—è, —â–æ –≤–∫–ª—é—á–∞—î –∂—ñ–Ω–æ–∫-–ª–µ—Å–±—ñ, –±—ñ—Å–µ–∫—Å—É–∞–ª—ñ–≤, —Ç—Ä–∞–Ω—Å–≥–µ–Ω–¥–µ—Ä—ñ–≤, —Ü–∏—Å-–≥–µ–Ω–¥–µ—Ä—ñ–≤ —Ç–∞ —ñ–Ω—à–∏—Ö —á–ª–µ–Ω—ñ–≤ –õ–ì–ë–¢-–∫–æ–º'—é–Ω—ñ—Ç—ñ. –¶—ñ—î—é —Å–∏—Å—Ç–µ–º–æ—é –∫–æ—Ä–∏—Å—Ç—É—î—Ç—å—Å—è —ñ –Ω–∞—à —Å–∞–π—Ç. –§—ñ–ª—å—Ç—Ä–∏ –∑–ª—ñ–≤–∞ —Å—Ç–æ—Ä—ñ–Ω–∫–∏ –¥–æ–ø–æ–º–æ–∂—É—Ç—å –æ–±—Ä–∞—Ç–∏ —Ñ—ñ–∑–∏—á–Ω—ñ –ø–∞—Ä–∞–º–µ—Ç—Ä–∏, –º–µ—Ç—É –∑–Ω–∞–π–æ–º—Å—Ç–≤–∞, –∞ –≤–≥–æ—Ä—ñ —Å—Ç–æ—Ä—ñ–Ω–∫–∏ –∑–∞ –Ω–∞—è–≤–Ω–æ—Å—Ç—ñ –∞–∫—Ç—É–∞–ª—å–Ω–∏—Ö –≥–µ–π-–æ–≥–æ–ª–æ—à–µ–Ω—å —î —ñ–Ω—Ç–µ—Ä–∞–∫—Ç–∏–≤–Ω—ñ –∑–∞–≥–æ–ª–æ–≤–∫–∏ "–≤—ñ–Ω —à—É–∫–∞—î –π–æ–≥–æ" –∞–±–æ "–≤–æ–Ω–∞ —à—É–∫–∞—î —ó—ó".</p>
		
			<br><ul>
			
				<li>–ù–∞–¥–∞–Ω—ñ –≥—Ä–∞–Ω—Ç–∏ - –ü—ñ–¥—Ç—Ä–∏–º–∞–Ω—ñ –ø—Ä–æ—î–∫—Ç–∏.</li>
			
				<li>–ü—Ä–∏–ª–æ–∂–µ–Ω–∏–µ –¥–ª—è –ª–µ—Å–±–∏—è–Ω–æ–∫.</li>
			
				<li>–¥–æ–¥–∞—Ç–æ–∫ –¥–ª—è –ø—ñ–¥–∫–ª—é—á–µ–Ω–Ω—è –ñ–¥–∞–Ω—ñ–≤–∫–∞ –£–∫—Ä–∞—ó–Ω–∞.</li>
			
				<li>–∑–Ω–∞–π–æ–º—Å—Ç–≤–∞ –∑ –¥—ñ–≤—á–∏–Ω–æ—é –∑ –Ü–∑—è—Å–ª–∞–≤ –£–∫—Ä–∞—ó–Ω–∞.</li>
			
