	<p>–ü—Ä–∏—Ä–æ–¥–Ω—ñ—Å—Ç—å –æ–¥–Ω–æ—Å—Ç–∞—Ç–µ–≤–∏—Ö –≤—ñ–¥–Ω–æ—Å–∏–Ω –Ω–∞—É–∫–æ–≤–æ –¥–æ–≤–µ–¥–µ–Ω–∞, –∞–ª–µ –ø–æ–≤–Ω–∞ –∑–º—ñ–Ω–∞ –∫—É–ª—å—Ç—É—Ä–Ω–æ—ó –ø–∞—Ä–∞–¥–∏–≥–º–∏ ‚Äî —Å–ø—Ä–∞–≤–∞ –¥–µ—Å—è—Ç–∏–ª—ñ—Ç—å. –ü—Ä–∏–π–Ω—è—Ç–∏ —Ä—ñ–≤–Ω–æ–ø—Ä–∞–≤–Ω—ñ—Å—Ç—å –ª—é–¥–µ–π –≥–µ–π-—Å–ø—ñ–ª—å–Ω–æ—Ç–∏ –∑–∞–≤–∞–∂–∞—é—Ç—å —Å—Ç—Ä–∞—Ö, —Ä–µ–ª—ñ–≥—ñ–π–Ω—ñ —É—Å—Ç–∞–Ω–æ–≤–∫–∏, —â–æ –ø–æ—Ä–æ–¥–∂—É—é—Ç—å —Ö–≤–∏–ª—ñ –Ω–µ–ø—Ä–∏–π–Ω—è—Ç—Ç—è —ñ –∞–≥—Ä–µ—Å—ñ—ó. –£ –≤–µ–ª–∏–∫–∏—Ö –º—ñ—Å—Ç–∞—Ö —Å–∏—Ç—É–∞—Ü—ñ—è –º–µ–Ω—à –Ω–∞–ø—Ä—É–∂–µ–Ω–∞, –∞–ª–µ –≤ –º–∞–ª–µ–Ω—å–∫–∏—Ö —Ä–∏–∑–∏–∫ –≤–∏–∫—Ä–∏—Ç—Ç—è –≤–µ–ª–∏–∫–∏–π. –ß–∏ –ø–æ—Ç—Ä—ñ–±–Ω–æ –≤—ñ–¥–º–æ–≤–ª—è—Ç–∏ —Å–æ–±—ñ –≤ –º—Ä—ñ—ó –ø—Ä–æ –æ—Å–æ–±–∏—Å—Ç–µ —â–∞—Å—Ç—è? –Ø–∫—â–æ —É –≤–∞—Å —î –ø—ñ–¥—Å—Ç–∞–≤–∏ –±–æ—è—Ç–∏—Å—è –≤–∏–∫—Ä–∏—Ç—Ç—è, –¥–æ—Ç—Ä–∏–º—É–π—Ç–µ—Å—å –∫—ñ–ª—å–∫–æ—Ö –ø—Ä–æ—Å—Ç–∏—Ö –ø—Ä–∞–≤–∏–ª –≥–µ–π-–∑–Ω–∞–π–æ–º—Å—Ç–≤ –æ–Ω–ª–∞–π–Ω:. –í–∞—Ä—ñ–∞–Ω—Ç —Ä—ñ—à–µ–Ω–Ω—è: –∑—Ä–æ–±—ñ—Ç—å –∑–Ω—ñ–º–æ–∫ —Å–ø–µ—Ü—ñ–∞–ª—å–Ω–æ –¥–ª—è –ø–æ–¥—ñ–±–Ω–æ–≥–æ –≤–∏–ø–∞–¥–∫—É, –¥–µ –æ–±–ª–∏—á—á—è —á–∞—Å—Ç–∫–æ–≤–æ –∞–±–æ –ø–æ–≤–Ω—ñ—Å—Ç—é –∑–∞–∫—Ä–∏—Ç–µ.</p>
